var w = $("#"+id);

endpoint.schema('documentation').table('bundle_doc').rows({
    where: {
        name: 'bundle_id',
        op: '=',
        value: bundle_id
    }
}).then(function(bundle_docs) {
    if(bundle_docs.length > 0) {
        bundle_docs.forEach(function(bundle_doc) {
            show_bundle_doc(bundle_doc);
        });
    } else {
        w.find('div.no_doc').show();
    }
}).catch(function(e) {
    alert('stage row select failed:'+e);
});

w.find('button.new_doc').click(function() {
    endpoint.schema('documentation').table('bundle_doc').insert({
        bundle_id: bundle_id
    }).then(function(bundle_doc) {
        show_bundle_doc(bundle_doc);
    });

});

function show_bundle_doc(bundle_doc) {
    w.find('div.no_doc').hide();
    w.find('> .content').html(widget('bundle_doc', { bundle_doc: bundle_doc }));
}

