begin;
create schema documentation;
set search_path=documentation;

create table row_doc (
    id uuid not null default public.uuid_generate_v4() primary key,
	row_id meta.row_id not null,
	title text not null default '',
	content text not null default ''
);

create table bundle_doc (
    id uuid not null default public.uuid_generate_v4() primary key,
	bundle_id uuid references bundle(id),
	title text not null default '',
	content text not null default ''
);
commit;

var w = $("#"+id);

w.find('> .tabs').html(widget('layout:tabs', {
    tabs: [
        {
            label: 'editor',
            color: '#f00',
            content: widget('docs'),
            show_first: true
        }, {
            label: 'schema',
            color: '#0f0',
            content: widget('schemas')
        }
    ],
    selected_tab_color: '#ccc'
}));

var w = $("#"+id);


endpoint.schema('bundle').table('bundle').row({
    where: {
        name: 'id',
        op: '=',
        value: bundle_id
    }
}).then(function(bundle) {
    w.find('.title').html(bundle.get('name'));
    endpoint.schema('documentation').table('bundle_doc').rows({
        where: {
            name: 'bundle_id',
            op: '=',
            value: bundle.get('id')
        }
    }).then(function(bundle_docs) {
        if(bundle_docs.length > 0) {
            bundle_docs.forEach(function(bundle_doc) {
                show_bundle_doc(bundle_doc);
            });
        } else {
            w.find('div.no_doc').show();
        }
    }).catch(function(e) {
        alert('stage row select failed:'+e);
    });
});

w.find('button.new_doc').click(function() {
    endpoint.schema('documentation').table('bundle_doc').insert({
        bundle_id: bundle_id
    }).then(function(bundle_doc) {
        show_bundle_doc(bundle_doc);
    });

});

function show_bundle_doc(bundle_doc) {
    w.find('div.no_doc').hide();
    w.find('> .content').html(widget('md_editor', { content_field: bundle_doc.field('content') }));
}

var w = $("#"+id);

console.log('content_field', content_field);

w.find('.menu .item').tab();

var md = new markdownit();
var result = md.render(content_field.value);

w.find('.segment[data-tab="display"]').html(result);
w.find('.segment[data-tab="edit"]').html(widget('ide:code_editor', {
    field: content_field,
    language: 'markdown'
}));

w.bind('code_changed', function(e, o) {
    var result = md.render(o.field.value);
    w.find('.segment[data-tab="display"]').html(result);

});

w.find('button.save').click(save);


function save() {
    content_field.row.update().then(function() {
        w.trigger('status','documentation saved.');
    });
}

