}

.{{= name }}:hover {
    background-color: #333;
}

var w = $("#"+id);

endpoint.schema('bundle').table('bundle').rows({
    order_by: {
        column: 'name'
    }
}).then(function(bundles) {
    widget.sync(bundles, w.find('select.bundle_id'), function(bundle) {
        return widget('tag:option', {
            label: bundle.get('name'),
            value: bundle.get('id')
        });
    });
});

w.find('select.bundle_id').change(function(b) {
    var bundle_id = $(this).val();
    w.find('.docs').html(widget('bundle_doc', { bundle_id: bundle_id }));

});

var w = $("#"+id);

w.click(function() {

    var params = f.related_rows('id','meta.function_parameter','function_id', {
        order_by: {
            column: 'position'
        }
    });
    widget.sync(params, w.find('.params'), function(param) {
        return widget('docs:schema_function_param', { param: param }) + '&nbsp;';
    });

    w.find('.content').html(
        widget('semantics/form_field', f.field('definition'))
    );

    // unbind
    w.off('click');
});

